void rand_arrows(int game_map[ROW][COL]){
	int dir;
	dir = rand()%5;
	for(int i = 6; i<9; i++){
		for(int j = 3; j<7; j++){
			dir = (rand()+1)%5;
			game_map[i][j] = dir;
			if(game_map[i][j]==2 && game_map[i-1][j]==1){
				game_map[i][j]==1;
			}
			if(game_map[i][j]==3 && game_map[i][j+1]==4){
				game_map[i][j]==4;
			}
			if(game_map[i][j]==4 && game_map[i][j-1]==3){
				game_map[i][j]==3;
			}
			if(game_map[i][j]==1 && game_map[i+1][j]==2){
				game_map[i][j]==2;
			}
		}
	}
}

bool update_xymouse(char key, int *x_mouse, int *y_mouse) {
  if (key == 0x1C) {
    if (*(x_mouse) > 0||*(x_mouse)< 15)
      *(x_mouse) = *(x_mouse)-1;
      
  }
  if (key == 0x23) {
    if (*(x_mouse) > 0||*(x_mouse)< 15)
      *(x_mouse) = *(x_mouse) + 1;
  }
  if (key == 0x1B) {
    if (*(y_mouse) > 0||*(y_mouse)< 16)
      *(y_mouse) = *(y_mouse) + 1;
  }
  if (key == 0x1D) {
    if (*(y_mouse) > 0||*(y_mouse)< 16)
      *(y_mouse) = *(y_mouse) - 1;
  }
  if (key == 0x29) return true;
  else return false;
}

void rotate_block(int game_map[][COL]){
	int temp;
    for (int i = 0; i<ROW / 2; i++) {
        int first = i;
        int last =ROW - i-1;
        for (int i = first; i<last; i++) {
            int offset = i-first;
            temp = game_map[first][i];
            game_map[first][i] = game_map[last - offset][first];
            game_map[last-offset][first] =game_map[last][last-offset];
            game_map[last][last-offset]= game_map[i][last];
            game_map[i][last] = temp;
        }
    }
}

void update_block(Block *box[ROW][COL], int x_mouse, int y_mouse, int *score) {
  clear_screen();
  plot_picture(background);
  for (int rows = ROW-1; rows >= 0; rows--) {
    for (int cols = 0; cols < COL; cols++) {
      if (box[rows][cols]->y > 219) {
        box[rows][cols]->moveblock = false;
      }
      if (box[rows][cols]->x > 299) {
        box[rows][cols]->moveblock = false;
      }
      if (box[rows][cols]->y < 0) {
        box[rows][cols]->moveblock = false;
      }
      if (box[rows][cols]->x < 0) {
        box[rows][cols]->moveblock = false;
      }
	  if (box[y_mouse][x_mouse]->direction == 1) {
        if(game_map[y_mouse][x_mouse-1]!=0){
			box[y_mouse][x_mouse]->moveblock = false;
		    game_map[y_mouse][x_mouse]=box[y_mouse][x_mouse]->direction;
			
		}
      }
      if (box[y_mouse][x_mouse]->direction == 2) {
        if(game_map[y_mouse][x_mouse+1]!=0){
			box[y_mouse][x_mouse]->moveblock = false;
		    game_map[y_mouse][x_mouse]=box[y_mouse][x_mouse]->direction;
			
		}
      }
      if (box[y_mouse][x_mouse]->direction == 3) {
        if(game_map[y_mouse-1][x_mouse]!=0){
			box[y_mouse][x_mouse]->moveblock = false;
		  game_map[y_mouse][x_mouse]=box[y_mouse][x_mouse]->direction;
			
		}
      }
      if (box[y_mouse][x_mouse]->direction == 4) {
        if(game_map[y_mouse+1][x_mouse]!=0){
			box[y_mouse][x_mouse]->moveblock = false;
			game_map[y_mouse][x_mouse]=box[y_mouse][x_mouse]->direction;
			
		}
      }
      if (game_map[rows][cols] == 1) {
        draw_left_block_init(rows * 20, cols * 20);
      }
      if (game_map[rows][cols] == 2) {
        draw_right_block_init(rows * 20, cols * 20);
      }
      if (game_map[rows][cols] == 3) {
        draw_up_block_init(rows * 20, cols * 20);
      }
      if (game_map[rows][cols] == 4) {
        draw_down_block_init(rows * 20, cols * 20);
      }
      if (box[rows][cols]->moveblock) {
        int x = (box[rows][cols]->x) / 20;
        int y = (box[rows][cols]->y) / 20;
        if (box[rows][cols]->direction == 1) {
          if (game_map[y][x - 1] != 0 &&
              (box[rows][cols]->x - 1 == box[rows][x - 1]->x + 20)) {
            box[rows][cols]->moveblock = false;
            game_map[rows][x] = box[rows][cols]->direction;
            box[rows][x - 1] = box[rows][cols];
          } else {
            box[rows][cols]->x = box[rows][cols]->x - 1;
            draw_left_block_init(box[rows][cols]->y, box[rows][cols]->x);
            // printf("x:%d, y:%d\n", box[rows][cols]->x, box[rows][cols]->y);
          }
        }
        if (box[rows][cols]->direction == 2) {
          if (game_map[y][x + 1] != 0 &&
              (box[rows][cols]->x + 20 == box[rows][x + 1]->x)) {
            box[rows][cols]->moveblock = false;
            game_map[rows][x] = box[rows][cols]->direction;
            box[rows][x + 1] = box[rows][cols];
          } else {
            box[rows][cols]->x = box[rows][cols]->x + 1;
            draw_right_block_init(box[rows][cols]->y, box[rows][cols]->x);
            // printf("x:%d, y:%d\n", box[rows][cols]->x, box[rows][cols]->y);
          }
        }
        if (box[rows][cols]->direction == 3) {
          if (game_map[y - 1][x] != 0 &&
              (box[rows][cols]->y - 1 == box[y - 1][cols]->y + 20)) {
            box[rows][cols]->moveblock = false;
            game_map[y][cols] = box[rows][cols]->direction;
            box[y - 1][cols] = box[rows][cols];
          } else {
            box[rows][cols]->y = box[rows][cols]->y - 1;
            draw_up_block_init(box[rows][cols]->y, box[rows][cols]->x);
            // printf("x:%d, y:%d\n", box[rows][cols]->x, box[rows][cols]->y);
          }
        }
        if (box[rows][cols]->direction == 4) {
          if (game_map[y + 1][x] != 0 &&
              (box[rows][cols]->y + 20 == box[y + 1][cols]->y)) {
            box[rows][cols]->moveblock = false;
            game_map[y][cols] = box[rows][cols]->direction;
            box[y + 1][cols] = box[rows][cols];
          } else {
            box[rows][cols]->y = box[rows][cols]->y + 1;
            draw_down_block_init(box[rows][cols]->y, box[rows][cols]->x);
            // printf("x:%d, y:%d\n", box[rows][cols]->x, box[rows][cols]->y);
          }
        }

      }
    }
  }
  draw_block_outline2(x_mouse, y_mouse, RED);
}

