void draw_line(int x0, int y0, int x1, int y1, short int color)
{
  int dx =  abs (x1 - x0), sx = x0 < x1 ? 1 : -1;
  int dy = -abs (y1 - y0), sy = y0 < y1 ? 1 : -1; 
  int err = dx + dy, e2; 

  while(x0 != x1 || y0 != y1){  
    plot_pixel(x0,y0, color);
    //if (x0 == x1 && y0 == y1) break;
    e2 = 2 * err;
    if (e2 >= dy) { err += dy; x0 += sx; } 
    if (e2 <= dx) { err += dx; y0 += sy; } 
  }
}

void draw_parallelogram(int x0, int y0, short int color){
  y0--;
  x0++;
  int k;
  draw_line(x0+10, y0-10, x0+BOX_DIMENSION+10, y0-10, WHITE);
    for (k=0; k < BOX_DIMENSION; k++) {
    if(k==0 || k==BOX_DIMENSION-1){
    draw_line(x0, y0, x0+10, y0-10, WHITE);
    }else{
        draw_line(x0, y0, x0+10, y0-10, color);
    }
    x0++;
    }
	draw_line(x0-BOX_DIMENSION+10, y0-10, x0, y0-10, WHITE);
	draw_line(x0,y0, x0+10, y0-10, WHITE);
}

void box_side(int x0, int y0, short int color){
  x0=x0+BOX_DIMENSION;
  y0=y0+BOX_DIMENSION;
  int x1 = x0+10;
  int k;
  //printf("x0:%d, y0:%d\n", x0,y0);
  draw_line(x0+10, y0-10, x0+10, y0-BOX_DIMENSION-11, WHITE);
  draw_line(x0, y0, x0+10, y0-10, WHITE);
    for (k=0; k < BOX_DIMENSION; k++) {
    if(k==0 || k==BOX_DIMENSION-1){
    draw_line(x0, y0, x1, y0-10, WHITE);
    }else{
        draw_line(x0, y0, x0+10, y0-10, color);
    }
    y0--;
    }
  draw_line(x0, y0+BOX_DIMENSION, x0, y0, WHITE);
}


