char ps2data() {
  volatile int *PS2_ptr = (int *)PS2_BASE;
  int PS2_data, RVALID;
  char byte1 = 0, byte2 = 0, byte3 = 0, byte4 = 0;
  PS2_data = *(PS2_ptr);       // read the Data register in the PS/2 port
  RVALID = PS2_data & 0x8000;  // extract the RVALID field
  if (RVALID) {
    /* shift the next data byte into the display */
    byte1 = byte2;
    byte2 = byte3;
    byte3 = PS2_data & 0xFF;
    return byte3;
  }
  return 0;
}

bool sound_check(int game_map[ROW][COL]){
	for (int rows = 0; rows < ROW; rows++) {
		for (int cols = 0; cols < COL; cols++) {
		  if (game_map[rows][cols] != 0) {
			return false;
		  }
		}
	}
	return true;
}

void plot_picture(int samples[]){
	for(int x = 0; x <320; x++){
		for(int y = 0; y<240; y++){ 
		 	plot_pixel(x, y, samples[y*320+x]);
		}
	}
}
	